public class Solution {
    public int MinGroupsForValidAssignment(int[] nums) {
        Dictionary<int, int> frequency = new Dictionary<int, int>();
        foreach (int num in nums) {
            if (frequency.ContainsKey(num)) frequency[num]++;
            else frequency[num] = 1;
        }

        List<int> frequencies = new List<int>(frequency.Values);
        frequencies.Sort();

        int groups = 0;
        while (frequencies.Count > 0) {
            int last = frequencies[frequencies.Count - 1];
            frequencies.RemoveAt(frequencies.Count - 1);
            groups++;
            for (int i = frequencies.Count - 1; i >= 0 && last > 1; i--) {
                frequencies[i]--;
                last--;
                if (frequencies[i] == 0) frequencies.RemoveAt(i);
            }
        }
        return groups;
    }
}
